import React, { Component } from "react";
import "./usercard.css";

function Card(props) {
  const data = props.Data;
  {
    data && console.log(data.data.data);
  }
  return (
    <>
      <div id="card">
        {data &&
          data.data.data.map((items, index) => {
            return (
              <>
                <div>
                  <img src={items.avatar} />
                </div>
                <div>
                  <table>
                    <tbody>
                      <tr>
                        <td>First Name</td>
                        <td>Last Name</td>
                        <td>Email</td>
                      </tr>
                      <tr>
                        <td>{items.first_name}</td>
                        <td>{items.last_name}</td>
                        <td>{items.email}</td>
                      </tr>
                    </tbody>
                  </table>
                </div>
              </>
            );
          })}
      </div>
    </>
  );
}

export default Card;
